<link href="../css/tiplami.css" rel="stylesheet" type="text/css" />
<script type="text/javascript">
$(document).ready(function() {
        // Tooltip only Text
        $('.lamirek').hover(function(){
                // Hover over code
                var title = $(this).attr('title');
                $(this).data('tipText', title).removeAttr('title');
                $('<p class="tooltip"></p>')
                .text(title)
                .appendTo('body')
                .fadeIn('slow');
        }, function() {
                // Hover out code
                $(this).attr('title', $(this).data('tipText'));
                $('.tooltip').remove();
        }).mousemove(function(e) {
                var mousex = e.pageX - 60; //Get X coordinates
                var mousey = e.pageY + 25; //Get Y coordinates
                $('.tooltip')
                .css({ top: mousey, left: mousex })
        });
});
</script>
